import React from 'react';

function Home() {
  return (
    <div>
      <h2>Welcome to IPO App</h2>
      <p>
        This platform allows you to apply for IPOs easily and track your applications.
      </p>

      <h3>Features of IPO App:</h3>
      <ul>
        <li>✔️ Browse upcoming and ongoing IPOs</li>
        <li>✔️ Apply online in just a few clicks</li>
        <li>✔️ Track status of your applications in real-time</li>
        <li>✔️ Secure and easy-to-use interface</li>
      </ul>

      <p>
        Start your investment journey today by applying for your favorite company’s IPO!
      </p>
    </div>
  );
}

export default Home;
